import React from 'react';
import ThemeSection from './sections/ThemeSection';
import got from '../assets/gameOfThrones.jpg';

class App extends React.Component {
  constructor(props) {
    super(props)
  }

  render() {
    return (
      <section>
        <ThemeSection key="0" title="Game of Thrones" image={got} />
      </section>
    )
  }
}

export default App;
